Airplane.create(equipment:'ATR', eq_name:'Avions De Transport Regional G.I.E', explain:'ATR42-600、ATR72-600は、高い快適性と環境性能（低燃費、低騒音）を兼ね備えた最新鋭ターボプロップ機。コックピットはエアバスA380の技術を取り入れたグラスコックピットに最新の航法機器を装備し、客室内は同クラスのターボプロップ機と比べて手荷物収納スペースが大きくなっている。座席はJAL国内線で運航されている「JAL SKY NEXT」仕様に準じた全席革張りシート、カラーリングであり、またLED照明を採用し、ARMONIAデザイン*によって明るく快適な空間となっている。')
Airplane.create(equipment:'AB3/ABF',eq_name:'Airbus A300/Airbus A300 Freighter', explain:'A300の最大の特徴として、250席から300席級というサイズの旅客機を双発機として実現したことがあげられる。A300は、客室内に2本の通路をもつワイドボディ機である。片持ち式の主翼を低翼に配置した単葉機であり、左右の主翼下に1発ずつターボファンエンジンを備える。尾翼も低翼配置で垂直・水平尾翼ともに胴体尾部に直接取り付けられている[142]。降着装置は前輪式配置で機首部に前脚、左右の主翼の付け根に主脚がある[52]。A300第1世代の機体全長は53.62メートル、全幅は44.84メートル、全高は16.53メートルである。')
Airplane.create(equipment:'220',eq_name:'Airbus A220', explain:'エンジンはプラット・アンド・ホイットニー社が開発しているGTF（ギヤード･ターボファン･エンジン）のPW1000Gシリーズ（PW1519G、PW1521G、PW1524G）が搭載される。
  また、ボンバルディア・エアロスペース社が中国で開発されたARJ21の開発に協力していた関係で、Cシリーズとの共通性を高めることも明らかにされている。機体の操縦方式は操縦桿に代わり、エアバスA320シリーズと同様のサイドステックを採用した。客室内径は3.28mを確保し、1列あたりの座席数はエコノミークラスの場合、リージョナル機（1列4席）とA320（同6席）の間となる、左2席-右3席の5席配列を採用することができる。単通路（ナローボディ）機ながら通路は20インチあり、客室乗務員や乗客が移動しやすくなるなど、客室居住性の向上が図られている。')
Airplane.create(equipment:'310',eq_name:'Airbus A310', explain:'A310は後退翼の主翼を低翼に配置した単葉機である。左右の主翼下に高バイパス比のターボファンエンジンを1基ずつ備える。通常の尾翼配置を採用し、水平尾翼と垂直尾翼は胴体尾部に直接取り付けられている。垂直尾翼の形状はA300から引き継がれたが、水平尾翼は再設計され、A300と比べて翼幅が4パーセント、面積は8パーセント小さくなった。A310の胴体はA300と同じ胴体断面を用い、合計13フレーム分短縮されて全長は46.66メートルである。降着装置は前輪式配置で、前脚が2輪・主脚は4輪である。')
Airplane.create(equipment:'319',eq_name:'Airbus A319', explain:'エアバス319-100は、ヨーロッパの国際協同会社であるエアバスが製造した単通路型で双発のジェット機。旅客機として世界で最も一般的に使用されているエアバスA320ファミリーの航空機となる。A319は、同等機種の航空機では最長の航続距離を誇る。A319は、最も定評のあるA320を小型化して開発された短胴型機。A320に比べて主翼の前後7フレーム減らした胴体以外は、A320とほぼ同じ設計仕様となる。')
Airplane.create(equipment:'320',eq_name:'Airbus A320', explain:'A320の機体構成は一般的な旅客機のものである。片持ち翼の主翼を低翼に配置した単葉機であり、左右の主翼下に1発ずつターボファンエンジンを備える。尾翼は通常配置で、垂直尾翼と水平尾翼はともに胴体尾部に直接取り付けられている。降着装置は前輪式配置で機首部に前脚、左右の主翼の付け根に主脚がある。全長は37.57メートル、全高は11.76メートル、全幅はウイング・チップ・フェンス装備型が34.10メートルでシャークレット装備型が35.80メートルである。')
Airplane.create(equipment:'321',eq_name:'Airbus A321', explain:'A321は片持ち翼の主翼を低翼に配置した単葉機である。全長は44.51メートル、全高は11.76メートル、全幅はウイング・チップ・フェンス装備型が34.10メートルでシャークレット装備型が35.80メートルである。左右の主翼下にパイロンを介して1発ずつターボファンエンジンを備える。尾翼は通常配置で、垂直尾翼と水平尾翼はともに胴体尾部に直接取り付けられている[87]。降着装置は引き込み式の前輪式配置で機首部に前脚、左右の主翼の付け根に主脚がある。前脚および左右の主脚はそれぞれ2輪式である。胴体断面はA320と同一で、幅は3.95メートル、高さが4.14メートルである。胴体長は全長と同じ44.51メートルである。A320と比較すると、主翼の前方で4.27メートル、後方で2.67メートル、合わせて6.94メートル胴体が長い。')
Airplane.create(equipment:'330/33F',eq_name:'Airbus A330/Airbus A330 Freighter', explain:'A330の胴体断面には、A300で開発された直径5.64メートル（222インチ）の真円断面がそのまま用いられている。全長は、A330-200が58.82メートル、A330-300が63.69メートルである。貨物室は、主翼を挟んで前後2区画に分かれており、いずれもLD-3航空貨物コンテナを2個並列に搭載可能である。また、最後部には、ばら積み貨物用の区画が設けられている。また、A340では床下貨物室に設置できる旅客用化粧室や乗員用休憩室などが用意されたが、A330でも必要があれば装備可能である。貨物室の扉は右舷にあり、前方と後方の貨物室には外開き式の大型扉、ばら積み貨物室には内開き式の小型の扉が設けられている。')
Airplane.create(equipment:'340',eq_name:'Airbus A340', explain:'A340は、客室内に通路を2本もつワイドボディ機で、片持ち式の主翼を低翼位置に配した単葉機であり、主翼下にターボファンエンジンを4発備える。水平尾翼は低翼に配置され、胴体尾部には補助動力装置としてガスタービンエンジンが内蔵されている。降着装置は前輪式配置であり、仕様によっては中央脚を備える。貨物室は、主翼を挟んで前後2区画に分かれており、いずれもLD-3航空貨物コンテナを2個並列に搭載可能である。さらに最後部には、ばら積み貨物用の区画が設けられている。貨物室の扉は右舷にあり、コンテナを搭載可能な前方・後方貨物室には外開き式の大型扉、ばら積み貨物室には内開き式の小型の扉が設けられている。')
Airplane.create(equipment:'350',eq_name:'Airbus A350', explain:'A300以来使用していた真円の胴体断面を捨て、新たにより太いダブル・バブル断面を採用。ダブル・バブルのキャビン部分の半径は2.98mと、ロッキード L-1011 トライスターと等しくエコノミークラスは9列配置が可能となった。貨物室部分の半径は2.82mとこちらは従来型エアバスワイドボディ機と同じで、少しでも工作機械や治具を流用しようという意図が見受けられる。また、ダブル・バブル構造とすることで胴体下半分はLD3コンテナが二列積載できる最小限の断面に絞られており機体重量の軽減に寄与している。新設計、全複合材製の高効率な主翼。主翼面積は従来A350の361m²からXWBでは443m²に拡張された。この値はボーイング777の424m²より大きい。')
Airplane.create(equipment:'380',eq_name:'Airbus A380', explain:'ヨーロッパのエアバス社によって開発・製造された、ターボファンエンジンを4発装備した超大型ワイドボディ機。世界初の総2階建旅客機でもあり、旅客機としては世界最大の機種である。また、航空機の中でもAn-225 ムリーヤに次いで世界第2位の大きさを誇る。A380は完成披露の時点で、それまで「ジャンボジェット」と呼ばれ機体の大きさが人気を集めた大型機であるボーイング747を抜いて、乗客数の面では世界最大かつ史上最大の超大型機となった。全長:72.7 m・全幅:79.8 m・全高:24.1 m')
Airplane.create(equipment:'727',eq_name:'Boeing 727', explain:'ボーイング727（Boeing 727）はアメリカ合衆国のボーイング社製の旅客機である。先発のボーイング707とは大きく異なり、T字尾翼と尾部に集中して搭載された三基のエンジンが特徴の、短・中距離用旅客機である。また、ボーイング社では唯一の三発ジェット旅客機であった(ボーイングが直接、設計・製造した中では唯一)。全長:46.7 m・全幅:32.9 m・全高:10.3 m')
Airplane.create(equipment:'737/73F',eq_name:'Boeing 737/Boeing 737 Freighter', explain:'ボーイング737（Boeing 737）は、アメリカ合衆国の航空機メーカー、ボーイング社が製造する小型ジェット旅客機である。リアエンジン3発式とされたボーイング社の前作ボーイング727とは異なり、エンジンは主翼の下に1発ずつ、計2発搭載されている双発仕様で、敢えて特殊なエンジンレイアウトを避け、整備性を重視した設計である。一方の胴体は設計費と生産単価の低減のため、先行した727と同じ設計（遡れば1958年就航の第一世代ジェット旅客機であるボーイング707以来の設計）を流用している。DC-9より太くてA320よりわずかに狭く、標準的なエコノミークラスであれば通路をはさんで横に6列の座席を配置できる。全長:33.60 m・全幅:34.30 m・全高:12.50 m')
Airplane.create(equipment:'73Q',eq_name:'Boeing 737-300QC', explain:'ボーイング737 クラシックは、アメリカ合衆国の航空機メーカー、ボーイング社が製造するボーイング737の第2世代の小型ジェット旅客機である。エンジンをそれまでの低バイパス比のJT8Dから高バイパス比のCFMインターナショナル製CFM56-3Bシリーズに換装し、燃費を大幅に向上させるとともに騒音を抑える効果も得られている。地上高の低い737に大直径のエンジンを装備するため、パイロンで主翼前方に突き出すとともに、独特なおむすび型のエンジンカウルが導入されている。外観上の特徴としてはエンジンの他に、空力面や強度向上の面から垂直尾翼のデザインが変更され、付け根が前に伸びていることがあげられる。翼は空気力学に基づく改善の変更をいくつか組み込み、翼端は、9インチ（22センチメートル）延長され、最先端のスラットと後縁フラップを調整した。全長:36.40 m・全幅:28.88 m・全高:11.07 m')
Airplane.create(equipment:'747/74F',eq_name:'Boeing 747/Boeing 747 Freighter', explain:'ボーイング747 (英: Boeing 747) は、アメリカのボーイング社が開発・製造する大型ジェット旅客機シリーズ。1969年2月の初飛行から多くの改良を重ね、半世紀経過した2019年現在も生産が続けられているロングセラーの航空機で、エアバスA380が初飛行するまでは世界最大の民間航空機であった。一般的には「ジャンボジェット（Jumbo Jet）」の愛称で呼ばれる。全長:76.4 m・全幅(翼端):68.5 m・全高:19.5 m')
Airplane.create(equipment:'757/75F',eq_name:'Boeing 757/Boeing 757 Freighter', explain:'ボーイング757（Boeing 757）は、アメリカのボーイングが開発・製造した中型の双発ジェット旅客機。757は主翼を低翼に配置した単葉機であり、胴体尾部に水平尾翼と垂直尾翼を直接取り付けた通常の尾翼構造を持つ。全長:54.43 m・全幅:38.06 m・全高:13.56 m')
Airplane.create(equipment:'767/76F',eq_name:'Boeing 767/Boeing 767 Freighter', explain:'ボーイング767（Boeing 767）は、アメリカ合衆国のボーイング社によって生産されている中型双発旅客機である。アメリカの主要都市を結ぶ航空路線用として開発された中距離旅客機である。同時期に開発されたボーイング757とともに、グラスコックピットを装備した「ハイテク機」と呼ばれ、自動着陸を含むオートパイロット機能をもつ。客室最大幅は4.7mあり、通路を2つ設けることが可能であるが、床下の貨物室はLD3コンテナ (en:Unit Load Device) を2個並列に並べることができず（専用のより小さいLD2コンテナなら並列に入る）、ワイドボディ機の標準からは外れている。これらのことから767の胴体はセミワイドボディ機に分類される。')
Airplane.create(equipment:'777/77F',eq_name:'Boeing 777/Boeing 777 Freighter', explain:'ボーイング777（Boeing 777）は、アメリカのボーイング社が開発した大型ワイドボディ双発ジェット機。非公式にトリプルセブン（Triple Seven）と呼ばれることもある。太い胴体の中央部を1階の客室に充てたため、その下の貨物室も広く確保できた上に、客室天井と機体上辺との間のかまぼこ型の空間には、前部と後部にそれぞれコックピット・クルー用とキャビン・クルー用の休憩室を設けることができるため[4][5]、長距離便でも交代乗務員用に客室や貨物室内に座席等を割り当てる必要がない。このように旅客と貨物の両面で収益が得られるよう考慮された飛行機であり、夜間に貨物専用便として運航されることもある。 全長:76.48m・全幅(翼端):71.3 m・全高:19.7 m')
Airplane.create(equipment:'787',eq_name:'Boeing 787', explain:'ボーイング787 ドリームライナー（Boeing 787 Dreamliner）は、アメリカ合衆国のボーイング社が開発・製造し、767・777の一部を後継する、次世代の長距離用中型ワイドボディ機。両翼にそれぞれ1基ずつ、計2基のターボファンエンジンを装備する双発機である。愛称は「ドリームライナー（Dreamliner）」であるが、この名前は、公募後に2003年6月のパリ航空ショー期間中に発表された。中型のワイドボディ機で、ナローボディの757やセミワイドボディの767、および777の一部の後継機と位置づけられている。特にターゲットとなる767より、航続距離や巡航速度は大幅に上回るとともに、燃費も向上している。東レ製の炭素繊維（カーボンファイバー）を使用した炭素繊維強化プラスチック等の複合材料の使用比率が約50 %[注 4][23]であり、残り半分が複合材料に適さないエンジン等なので、実質機体は完全に複合材料化されたといえる。 全長:68.3mm・全幅(翼端):60.1m・全高:16.9 m')


